import React, { Component } from "react";
import "./styles.scss";


class Header extends Component {
   render() {
      return (
         <div className="container-fluid" id="header">
            <div className="container header-content">
               <div className="row">
                  <div className="col-6">
                     
                  </div>
               </div>
            </div>
         </div>
      );
   }
}

export default Header;
